<!DOCTYPE html>
<html>
<head>
	<title>完成</title>
	<meta charset="utf-8">
	<meta name="viewport" content="width=device-width, initial-scale=1.0">
</head>
<style type="text/css">
	body{
		margin: 0;
		padding: 0;
		font-family: "Helvetica Neue", Helvetica, Arial, sans-serif;
		text-align: center;
	}

	.done_page{
		display: inline-block;
		margin-top: 200px;
	}
	.done_page > img{
		width: 128px;
		height: auto;
		vertical-align: top;
	}

	.done_page > .text{
		display: inline-block;
		margin-left: 50px;
		width: 300px;
		text-align: left;
	}
	.done_page > .text > h1{
		font-size: 60px;
		color: #3a3a3a;
		font-weight: normal;
		margin:0;
		line-height: 1;
		margin-top: 40px;
		margin-bottom: 20px;
		letter-spacing: 4px;
		margin-left: -2px;
	}
	.done_page > .text > p{
		font-size: 14px;
		color: #3a3a3a;
		margin:0;
		line-height: 1.5;
		margin-bottom: 10px;
		font-weight: bold;
		letter-spacing: 2px;
	}
	.done_page > .text > span{
		font-size: 12px;
		color: #999;
		margin:0;
		line-height: 1.5;
		display: block;
		margin-bottom: 30px;
		letter-spacing: 1px;
	}
	.done_page > .text > .btn{
		line-height: 34px;
		display: inline-block;
		padding: 0 16px;
		border-radius: 34px;
		color: #fff;
		font-size: 14px;
		cursor: pointer;
		background-color: #0063CA;
		transition: all 0.2s ease-out;
		margin-right: 10px;
		text-decoration: none;
	}
	.done_page > .text > .btn:hover{
		background-color: #0173ea;
	}
	.done_page > .text > .btn2{
		line-height: 32px;
		display: inline-block;
		border: 1px solid #ddd;
		padding: 0 16px;
		border-radius: 34px;
		color: #3a3a3a;
		font-size: 14px;
		cursor: pointer;
		transition: all 0.2s ease-out;
		font-style: none;
		text-decoration: none;
	}
	.done_page > .text > .btn2:hover{
		background-color: #ededed;
	}
	@media screen and (max-width: 968px){
		.done_page{
			text-align: center;
			margin-top: 100px;
		}
		.done_page > img{
			width: 80px;
		}
		.done_page > .text{
			display: block;
			text-align: center;
			margin-left:0;
		}
		.done_page > .text > h1{
			font-size: 32px;
		}
	}
</style>
